import styles from "./ListUser.module.css";

export default function ListUser({ id, user, name, company, cnpj }) {
  return (
    <tr key={id} className={styles.containerUserInfo}>
      <td className={styles.user}>{user}</td>
      <td className={styles.name}>{name}</td>
      <td className={styles.empresa}>{company}</td>
      <td className={styles.cnpj}>{cnpj}</td>
    </tr>
  );
}
